import React from 'react'

function header() {
    return (
        <div className="w-full flex items-center justify-between bg-green-900 h-20">
            <h4>Final Proje</h4>
            <div className="flex">
                <input className="flex h-10 rounded-lg" placeholder="search" type="text"></input>

            </div>
            <div>Login</div>
        </div>
    )
}

export default header
